const Box = ({id, boxColor, boxWidth, boxHeight }) => {

  return (
    <div id={id} style={{color: {boxColor}, width: `${boxWidth}px`, height: `${boxHeight}px`} }>
        <h3>Box Div</h3>
    </div>
  )
}

export default Box;
